## I18n Violations in a Library Platform

### 1. Hardcoded Text in JavaScript

**Violation:**
```javascript
function displayBookDetails(book) {
  alert(`You have borrowed the book "${book.title}" by ${book.author}.`);
}
```

**Explanation:** The text within the alert is hardcoded in English. If the platform needs to support other languages, this code will not work as expected.

**Inconsistent File Structure Issue:** If the platform has a separate `i18n` folder with language files, this hardcoded text is not utilizing those files, leading to inconsistent structure and maintenance issues.

### 2. Incorrect Key Usage in Translation Files

**Violation:**
```javascript
// en.json
{
  "borrowed_book": "You have borrowed the book \"{bookTitle}\" by {author}."
}
```
```javascript
// French translation is incorrect
// fr.json
{
  "borrowed_book": "Vous avez emprunté le livre \"{bookTitle}\" par {author}."
}
```

**Explanation:** The French translation is incorrect because it uses the wrong verb tense. The correct translation should be "Vous avez emprunté le livre \"{bookTitle}\" de {author}.".

**Inconsistent File Structure Issue:** The incorrect key usage in the French translation file leads to inconsistent behavior across languages.

